import "./Home.css";
import  NavbarHome from "../Navbar-Home/NavbarHome";
import Espufi from "../Espufi/Espufi"
import PufiRain from "../Pufi-Rain/Pufi-Rain";
import PufiPuff from "../Pufi-Puff/PufiPuff"

export const Home = () => {
    return (
      <div className="home" >
        <NavbarHome/>
        <Espufi/>
        <PufiRain/>
        <PufiPuff/>
      </div>
    );
  };

  export default Home;
